import React, { useEffect } from 'react';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import { get } from 'lodash';
import { getDataHome } from '../../redux-modules/modules/Home';
import Navigation from '../../components/navigation/Index';
import { IoIosHeartEmpty, IoIosSearch } from "react-icons/io";

const Home = (props) => {
    const { getDataHome } = props;
    useEffect(() => {
        getDataHome();
    }, [getDataHome])
    const { dataHome } = props;
    const { data } = dataHome;
    let categories = [];
    if (data) {
        if (data.category) {
            if (data.category.length > 0) {
                data.category.map((data, index) => {
                    categories.push(
                        <div className="d-flex p-2" key={index}>
                            <div className="col-sm-4">
                                {data.name}
                            </div>
                        </div>,
                    );
                    return data;
                })
            }
        }
    }
    return (
        <div className="wrapper">
            <Navigation />
            <div className="home">
                <div className="d-flex margin-top-4">
                    <IoIosHeartEmpty className="fa-heart text-left" />
                    <span className="position-relative search text-right">
                        <IoIosSearch className="search-icon" />
                        <input
                            className="input-search"
                            autoComplete="off"
                            type="text"
                            name="search"
                        />
                    </span>
                </div>
                {categories}
            </div>
        </div>
    );
}
const mapStateToProps = (state, props) => ({
    dataHome: state.home,
});

const mapDispatchToProps = dispatch => bindActionCreators({
    getDataHome,
}, dispatch);
export default connect(mapStateToProps, mapDispatchToProps)(Home);
